import React, { Component } from "react";
import Item from "./Item";

export class Items extends Component {
  render() {
    return (
      <main>
        {this.props.items.map((item) => {
          return <Item item={item} key={item.id} />;
        })}
      </main>
    );
  }
}

export default Items;
